import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

import { FaRunning, FaCompactDisc, FaPlayCircle} from "react-icons/fa";

class Header extends Component {
    render() {
        return (
            <div>
                <Navbar variant="pills" className="navbar" fixed="top">
                <Nav fill variant="pills" defaultActiveKey="/home" className={"justify-content-center"}>
                    <Nav.Item>
                        <a className="navbar-brand" href="/library">Canciones</a>
                        <FaCompactDisc/>
                    </Nav.Item>
                    <Nav.Item>
                        <a className="navbar-brand" href="/music">Musica</a>
                        <FaRunning/>
                    </Nav.Item>
                </Nav>
                </Navbar>

                <div className="waveWrapper waveAnimation">
                    <div className="waveWrapperInner bgTop">
                        <div className="wave waveTop"/>
                    </div>
                    <div className="waveWrapperInner bgMiddle">
                        <div className="wave waveMiddle"/>
                    </div>
                    <div className="waveWrapperInner bgBottom">
                        <div className="wave waveBottom"/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
